import React from "react";
import {
  Nav,
  NavItem
} from 'reactstrap';
import { NavLink } from 'react-router-dom';

const OrderPageHeader = () => {

  const HeaderRootStyle  = styled.div`
  background:#DC143C;
  height:20vh;
`

return (
<HeaderRootStyle>
  <Nav>
    <NavItem>
      <NavLink to="/">Anasayfa</NavLink>
    </NavItem>
    <NavItem>
      <NavLink href="#">Seçenekler</NavLink>
    </NavItem>
    <NavItem>
      <NavLink disabled href="#">Sipariş Oluştur</NavLink>
    </NavItem>
  </Nav>
</HeaderRootStyle>


)
}

export default OrderPageHeader;
